import Notes from "./Notes";
import { useState } from 'react';

export const Home = (props) => {
  const { showAlert } = props;
  const userInitial = [];
  const [user, setUser] = useState(userInitial);

  return (
    <div className="my-3">
      <h1 className="my-4">Welcome, </h1>
      <Notes showAlert={showAlert} />
    </div>
  );
};
